import dynamic from 'next/dynamic';
import withAuth from '../../src/helpers/withAuth';
import NavDashboard from '../../src/components/Controls/NavDashboard';

const DashboardComponent = dynamic(() =>
    import('../../src/components/DashboardPages/DashboardComponent'));

const Dashboard = () => {
  let [active, setActive] = useState(0);

  const ActiveComponent = number => {
    switch (number) {
      case 0:
        return <DashboardComponent />;

    }
  };

  return (
      <Fragment>
        <NavDashboard />
        <section className="container mx-auto px-16 py-32 relative">
          {
            activeComponent
          }
        </section>
      </Fragment>
  );
};

export default withAuth(Dashboard);
